public int hashCode() {
  HashCodeBuilder builder = new HashCodeBuilder();
  builder.append(getWorkerId())
      .append(getTaskId())
      .append(getRunState())
      .append(getStartTime())
      .append(getEndTime())
      .append(getTaskCMD())
      .append(getTaskType())
      .append(getExitCode());
  return builder.hashCode();
}
